import './App.css';
import Navbar from './components/Navbar.js';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header>
        <Router>
          <Navbar />
        </Router>
        <h1>hello</h1>
      </header>
    </div>
  );
}

export default App;
